import React from 'react'
import { Outlet } from 'react-router-dom';
import WaitForAdminConfirmation from './WaitForAdminConfirmation';

const Home = (props) => {
  return (
    <div>
        {props.code ? <Outlet code={props.code} id={props.id} email={props.email}/> : <WaitForAdminConfirmation/>}
        {}
    </div>
  )
}

export default Home
